import {React,useState} from 'react'
import pro from '../Util/professional'


const Professional = () => {

const [say, setSay] = useState(pro)
  return (
    <div className='Expierence'>
      <div>
        <h2>Professional Expiernce & Certifications</h2>
        <hr />
        {say.map((exp)=>{
                    const {id,Quote,song,Album,Year,img} = exp;
                    return(
                        <div className="quote-card" key={id}>
                            <img src={img} alt="" />
                            <h3>"{song}" in {Album} | {Year}</h3>
                            <hr />
                            <p>"{Quote}"</p>
                        </div>
                    )
                })}
      </div>
      <div>
        <img src="" alt="" />
      </div>
    </div>
  )
}

export default Professional
